import React from 'react';
import './App.sass';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Main} from "./app/pages/Main";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' caseSensitive element={<Main />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
